@turkishairlines has let a group of children take control of a plane in celebration of Turkey’s National Sovereignty and Children's Day. ✈️ 

Using motion capture technology, the children commanded the huge plane to pitch, roll and land, making for a very interesting experience.

✈️Happy April 23rd Children’s Day 🎈

@Casaangelinalifestyle remains one of the best-kept secrets on the Amalfi Coast; a hotel design that blends subtly into the sheer cliffs and offers unparalleled views of sea, mountains and the pure azure sky 🍋 
Have you visited the Amalfi Coast before? 💛
